import { useState } from 'react';
import SkillBar from './SkillBar';
import SkillPie from './SkillPie';
import {Card, Typography} from '@mui/material';



export default function Dashboard() {



    return (
        <div
            className="dash-container"
            style={{
                display:"flex"
            }}
        >

            <Card
                className=" card role-exp-pie"
                sx={{
                    padding:"30px",
                    width:"30%"
                }}
                >
                    <Typography 
                        variant='h5'
                        sx={{
                            textAlign: "left"

                        }}
                        >Roles</Typography>
                        <SkillPie />


            </Card>
            <Card
                className="card skill-exp-bar"
                sx={{
                    padding:"30px 10px 30px 20px",
                    width:"80%",
                    height:"100%"
                }}
            >
                <Typography 
                        variant='h5'
                        sx={{
                            textAlign: "left"

                        }}
                        >Skills </Typography>

                <SkillBar />
            </Card>


</div>
    );
}
